  return (
    //  need Fragment to run the code : <> and </>
    <>
    <div className="box" styles={{backgroundImage:`url(${background})`}}>
    <h1> Conversion Rate</h1>
    <Currencybox />
    <div className="equals"> || </div>
    <div className="equals"> || </div>
    <div className="equals"> \/ </div>
    <Currencybox/>
    </div>
    </>

  );
}

export default App;
